import React from 'react';
import HomePageCaursole from './homepageCaursole';
import image1 from '../../images/online-shopping-m-1024x683.jpg';
class Home extends React.Component {
    state = {
        data: []
    }
    render() {
        return (
            <div>
                <HomePageCaursole imag1={image1} />
            </div>
        )
    }
}
export default Home;
